import { Container, Jumbotron,Row,Col } from 'react-bootstrap';
import './App.css';

function App() {
  return (
    <div className="App">
      <Container>
        <Jumbotron>
          <Row >
            <Col xs={3}></Col>
            <Col xs={6}>
              <p>Faraz's Calculator</p>
            </Col>
            <Col xs={3}></Col>
          </Row>
        </Jumbotron>
      </Container>

    </div>
  );
}

export default App;
